import React from "react";

export default function ComParametro (props){
    const status = p.nota >= 7 ? 'Aprovado' : 'Reprovado'
    return(

        <div>
            <h2>{props.titulo}</h2>
            <p>
                <strong>{props.aluno}</strong>
                tem nota
                <strong>{props.nota}</strong>
                e esta 
                <strong>{status}</strong>
            </p>
        </div>

    )


}
